import Container from 'react-bootstrap/Container';
import 'bootstrap/dist/css/bootstrap.min.css';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

import Card2 from '../components/ComCardrec'
import Navbar1 from '../components/Navbar1';
import Card1 from '../components/Card1rec';
import Titles1rec from '../components/Titles1rec';
import SearchBar from '../components/Searchbar';

import taco from '../components/taco.jpg';
import profile from '../components/ProfilePic.jpg'



function Grid2() {
  return (
  <Container> 
  <Row>
      <Navbar1/>
  </Row>
  <div className='padding'>
  <Row> <Col><SearchBar label="Search for restaurants"/></Col>
  <Col><SearchBar label="Search by Location"/></Col>
  </Row>
  </div>
  <div className='padding'>
  <Row>
      <Col xs={6}><Titles1rec word="Recipes"/></Col>
      <Col xs={6}><Titles1rec word="Reviews"/></Col>
  </Row>
  </div>
  <Row>
        <Col xs={6}><Card1 name="Paw-Fil-A" photo= {dog} title={1} desc="Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation "/></Col>
        <Col xs={6}><Card2 photo= {profile}/></Col>
  </Row>
  <Row>
        <Col xs={6}><Card1 name="Tacos el Gato" photo={taco} title={1} desc="This restaurant serves..."/></Col>
        <Col xs={6}><Card2 photo={profile}/></Col>
  </Row>
  </Container>
  );
}

export default Grid2;
